import { Grid, makeStyles, Container, Divider } from "@material-ui/core";

//componentes
import Info from "./Info";
import Direccion from "./Direccion";
const useStyle = makeStyles({
});

const Index = () => {
    const classes = useStyle();

    return (
        <Container fixed >
            <Grid container >
                <Info />
                <Divider />  
                <Direccion />    
            </Grid>

        </Container>
    );
};

export default Index;
